import React, { useState } from "react";

function BotCollection({ bolt }) {
  const [add, setAdd] = useState(bolt);

  const handleClick = (boll) => {
    setAdd( boll);
  };

  if (bolt.length > 0) {
    return Object.keys(bolt).map((index) => {
      return (
        <div className="ui four column grid">
          {/* <div>{add}</div> */}
          <div className="row">
            <div>
              <img
                className="images"
                src={bolt[index].avatar_url}
                alt={index}
                onClick={handleClick(bolt[index])}
              />
              <p> {bolt[index].name}</p>
              <span>{bolt[index].health}</span>
              <span>{bolt[index].damage}</span>
              <span>{bolt[index].armor}</span>
            </div>
          </div>
        </div>
      );
    });
  }
  return (
    <div className="ui four column grid">
      <div className="row">
        <div></div>
      </div>
    </div>
  );
}

export default BotCollection;
